INSERT INTO `c_blog_posts` (`post_id`, `category_id`, `post_title`, `short_description`, `description`, `like_counter`, `status`, `created`, `user_id`, `meta_keywords`, `meta_description`, `photo`) VALUES
(3, 1, 'How to find the Ads for sharing? ', 'In order to find the Ads of own choice,', '<p>Once you are done with setting up your profile, you click on &ldquo;<strong>ShareAds&rdquo;</strong> module in order to find and select the Ads from a list of Categories.</p>\r\n\r\n<ul>\r\n	<li>You will find Ads with the help of Advanced Search or by filtering own choice such as\r\n	<ul>\r\n		<li>All categories</li>\r\n		<li>Most Popular</li>\r\n		<li>Highest Paying</li>\r\n		<li>Lowest Paying; whatever you wish to advertise to earn your commission;</li>\r\n	</ul>\r\n	</li>\r\n	<li>Now, if you see, you can directly share the ad over your social media accounts such as Facebook, Twitter, LikedIn. Or you can also copy this link from here to share. From this Email button, you can also send the links to your friends and family directly.&nbsp;</li>\r\n</ul>\r\n', 0, 1, 1517896586, 0, '', '', 'Your-Ad-Here2_35429992806.jpg'),
(4, 2, 'Add new Ads', 'This blog is about adding any new product:', '<p>So once you are done with setting up profile, you can see <strong>&ldquo;Product&rdquo;</strong> module from where you can Add new products.</p>\r\n\r\n<ul>\r\n	<li>If you are a New publisher and have not provide your Paypal email, you will be unable to Add new product. So first of all you have to complete your profile.</li>\r\n	<li>If you have already completed your profile and you have added Paypal email details, then you can Add new product from &ldquo;Add New&rdquo; button. &nbsp;</li>\r\n	<li>For adding any product, you have to follow few steps, first of all you have to select a Category from drop down section such as Business, E-Business, Travel etc. Each category contains sub-category&nbsp;and Product type such as Site products, products etc.</li>\r\n	<li>Then you have to add a title, listing details and Referral URL for your product. Referral URL is basically used to get links for newly created product.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 1, 1518590243, 0, '', '', 'businessadvertising-500x221_87472103629.jpg'),
(5, 1, 'Facebook and Google Revamp Policies and Features Against Bad Ads', 'There were three updates that the social networking site talked about,', '<p>One of them was how the Trending feature would look. Previously, the feature initially only showed a trending topic and if the user clicked on it, they would be taken to a &ldquo;results page&rdquo; that shows different posts and outside sources talking about the topic. Now, while the results page is still intact, Facebook Trending will feature the trending article&rsquo;s headline underneath the topic, without having to go to a results page to see it. It will show the source of the article as well.<o:p></o:p></p>\r\n\r\n<p>Facebook is also changing how the feature will curate trending articles. Instead of basing Trending on a user&rsquo;s interests, the algorithm will be focused on trending articles in a geographic area. This is done in hopes that people in the same region, such as the U.S., will see the same news articles.<o:p></o:p></p>\r\n\r\n<p>Their third update centers on the legitimacy of topics. Before the update, the algorithm simply chose articles that were shared the most by users. With the update in place, Facebook Trending will now choose news stories that were the most widely covered by news outlets.<o:p></o:p></p>\r\n\r\n<p>Google has also gone after fake news. As we have discussed in a previous post, Google released a report on the 25<sup>th</sup> about the 1.7 billion bad ads they took down. In addition to the individual ads, they also banned around 200 publishers from AdSense that violated their updated misrepresentative content policy to crack down on publishers who knowingly accepted fraudulent ads.<o:p></o:p></p>\r\n', 0, 1, 1518592135, 0, '', '', 'facebook-google-snapchat-stories-news_71897219913.png'),
(6, 3, 'Power Tips for Mobile Ads', 'Mobile can be a powerful marketing tool when handled correctly', '<p>Mobile ads are an amazing way to reach your on-the-go audience. Using mobile ads will put your message right in front of people, on their Smartphones or tablets, as they go about their day.<br />\r\nResearch has shown that over 90% of the people in the US goes between mobile and desktop throughout their day to accomplish their goals. Here are a few tips to make your mobile campaigns succeed:<o:p></o:p></p>\r\n\r\n<p><strong>1. Use Geo-Targeting</strong> &ndash; one of the great things about mobile is the ability to use precise Geo-targeting for a campaign. Even if you are a national or international brand, sending a targeted message to a mobile audience can increase lift, conversions, and brand recognition. Combining time-of-day targeting in addition to location targeting can also boost campaign performance exponentially. <o:p></o:p></p>\r\n\r\n<p><strong>2. Give a Clear Call to Action</strong> &ndash; With mobiles, you have a lot less room to display information. Make sure that both your creative and landing pages have clear calls to action for the user. Also, consider splitting up a lead form to multiple pages with the most important fields early on in the process.<o:p></o:p></p>\r\n\r\n<p><strong>3. Make Your Landing Pages Mobile Optimized</strong> &ndash; Make sure your entire landing page flow is mobile optimized. This includes all pages that are linked to your landing page including privacy policies, terms and conditions, etc. You never want any jarring experiences for users on a mobile phone. Test your pages on multiple platforms to ensure everything displays correctly. Make sure no pages have any Adobe Flash components or very advanced CSS or HTML5.<o:p></o:p></p>\r\n', 3, 1, 1518592402, 0, '', '', 'power-of-mobile_47733392287.png'),
(7, 4, 'Social Power', 'Social power, defined as \"the ability to set standards', '<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\">Social power, defined as &quot;the ability to set standards, create norms and values that are deemed legitimate and desirable, without resorting to coercion or payment,&quot; is a central part of contemporary international politics.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 1, 1535445014, 0, 'Social Power', '', 'maxresdefault_22384881322.jpg');
