(1, 'Contact Us', 'contact-us', '<p>If you have any questions or want to give any feedback about ShareAds, we would love to hear it from you. Please fill out the form below. We will get back to you shortly.</p>\r\n', 1, 1, 1, 0, 1, 'Affiliate ', 'Affiliate Marketing', 1, 0, 1, 2016),
(8, 'Terms of Use', 'terms-of-use', '<div><strong>PLEASE READ THESE TERMS OF USE CAREFULLY BEFORE USING THIS SITE</strong></div>\r\n\r\n<p><strong>TERMS OF WEBSITE USE</strong></p>\r\n\r\n<p>These terms of use (together with the documents referred to in it) tells you the terms on which you may make use of our website <a href=\"https://www.shareads.com\">www.shareads.com</a>&nbsp;whether as a guest or a registered user. Use of the Website includes accessing, browsing, or registering to use the Website.</p>\r\n\r\n<p>Please read these terms of use carefully before you start to use the Website, as these will apply to your use of the Website. We recommend that you print a copy of this for future reference.</p>\r\n\r\n<p>By using the Website in any manner, you confirm that you accept these terms of use and that you agree to comply with them.</p>\r\n\r\n<p>If you do not agree to these terms of use, you must not use the Website.</p>\r\n\r\n<p>Other applicable terms</p>\r\n\r\n<p>These terms of use refer to the following additional terms, which also apply to your use of the Website:</p>\r\n\r\n<ul>\r\n	<li>Our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a>, which sets out the terms on which we process any personal data we collect from you, or that you provide to us. By using the Website, you consent to such processing and you warrant that all data provided by you is accurate.</li>\r\n	<li>Our <a href=\"https://www.shareads.com/pages/cookie-policy\">Cookie Policy</a>, which sets out information about the cookies on the Website.</li>\r\n</ul>\r\n\r\n<p>In the event a User breaches these terms of use or any of the terms above, we reserve the right to cease the User&rsquo;s access to the Website and suspend any User&rsquo;s account.</p>\r\n\r\n<p>Information about us</p>\r\n\r\n<p>www.shareads.com&nbsp;is a site operated by Biz Mi Limited (&quot;We&quot;). We are registered in England and Wales under company number 09378935 and have our registered office at 1st Floor 2 Woodberry Grove, Finchley, London, N12 0DR.</p>\r\n\r\n<p align=\"left\">&nbsp;</p>\r\n\r\n<p align=\"left\"><strong><u>Defined Terms</u></strong></p>\r\n\r\n<p>&ldquo;<strong>Affiliate</strong>&rdquo; means the company or party who has agreed to make their online advertisements available to us to share.</p>\r\n\r\n<p>&ldquo;<strong>Ad</strong>&rdquo; means the advertisement of an Affiliate made available on the Website to Users to share.</p>\r\n\r\n<p>&ldquo;<strong>Introduced User</strong>&rdquo; means a User who creates an account on our Website using another User&rsquo;s unique introduction code.</p>\r\n\r\n<p>&ldquo;<strong>Link(s)</strong>&rdquo; means the unique link to an Ad provided to a User to share that Ad.</p>\r\n\r\n<p>&ldquo;<strong>Listing</strong>&rdquo; means the listing on the Website which displays the Ads that are available to be shared and the terms associated with sharing that Ad.</p>\r\n\r\n<p>&ldquo;<strong>Premium User</strong>&rdquo; means a User who has an active premium user subscription.</p>\r\n\r\n<p>&ldquo;<strong>Service</strong>&rdquo; refers to the service we provide to Users by making Links available to be shared by Users in exchange for payment and any other service provided by us through the Website to any User.</p>\r\n\r\n<p>&ldquo;<strong>User</strong>&rdquo; means any person or party who accesses or uses the Website.</p>\r\n\r\n<p>&ldquo;<strong>Website</strong>&rdquo; means www.shareads.co.uk and any other website or related mobile or other applications edited, maintained or operated by us&nbsp; alone or with others which offers similar services including any microsites, sub-sites or social media pages offered through any such website or application.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to these terms</strong></p>\r\n\r\n<p>We may revise these terms of use at any time by amending this page.</p>\r\n\r\n<p>Please check this page from time to time to take notice of any changes we have made, as they are binding on you.</p>\r\n\r\n<p><strong>Changes to the Website</strong></p>\r\n\r\n<p>We may update the Website from time to time, and may change the content at any time. Please note that any of the content on the Website may be out of date at any given time and we are under no obligation to update it.</p>\r\n\r\n<p>We do not guarantee that the Website, or any content on it, will be free from errors or omissions.</p>\r\n\r\n<p><strong>Your account and password</strong></p>\r\n\r\n<p>In order to use our Service each User must create a User account and agrees to provide any User information requested by us. Users will be required to provide their first name, last name, valid telephone number, email address, Paypal payment details and any other requested information.</p>\r\n\r\n<p>Users are only permitted to register one account per User for their own use. Users are not permitted to impersonate any other person, company or other entity or use the Website for commercial purposes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you choose, or you are provided with, a user identification code, password or any other piece of information as part of our security procedures, you must treat such information as confidential. You must not disclose it to any third party.</p>\r\n\r\n<p>We have the right to disable any User&rsquo;s identification code or password, whether chosen by you or allocated by us, at any time, if in our reasonable opinion you have failed to comply with any of the provisions of these terms of use.</p>\r\n\r\n<p>If you know or suspect that anyone other than you knows your identification code or password, you must promptly notify us at <a href=\"mailto:info@shareads.com\"><strong>info@shareads.com</strong></a></p>\r\n\r\n<p><strong>Our Service</strong></p>\r\n\r\n<p>Our Website provides a service to pay Users for sharing our Affiliates&rsquo; Ads with other parties via social media and email. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We will generate a Link for a User to share. That Link will be able to identify the User and the User will be paid for how many times their Link is viewed, clicked on, shared or generates a market lead for our Affiliates (as applicable).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Users on our Website are not engaged or employed by us or our Affiliates. Users do not provide any services on our behalf, or our Affiliates&rsquo; behalf, as agents, contractors nor as employees. Users use our Website as individual entities and shall remain as such for employment purposes. We shall not be deemed an employer or contractor of any User and shall not be liable for any employment taxes, compensation or benefits.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Users are responsible for paying and declaring any payments made to them by our Service.</p>\r\n\r\n<div><strong>Premium Subscription</strong></div>\r\n\r\n<p>A Premium User will benefit from:</p>\r\n\r\n<ul>\r\n	<li>a higher payment per Ad shared, as set out in each Ad Listing.</li>\r\n	<li>a flat fee payment of &pound;2 (two pounds sterling) for each Introduced User who creates an account using your Premium User&rsquo;s unique code.</li>\r\n	<li>commission of 20% of an Introduced User&rsquo;s commission (subject to the below payment terms).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Users may purchase a subscription to become a Premium User (&ldquo;<strong>Subscription(s)</strong>&rdquo;). The fees for a Subscription and the length of a Subscription are clearly displayed on our Website.</p>\r\n\r\n<div>Unless stated otherwise, Subscriptions will automatically renew at the end of each subscription period unless a User cancels the Subscription by giving us 14 days&rsquo; notice by email. The cancellation will take effect the day after the last day of the current subscription period.</div>\r\n\r\n<p>We accept the following payment methods: PAYPAL.</p>\r\n\r\n<div><strong>Payment</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Unless otherwise stated on our Website, we shall pay Users a commission for payment received from our Affiliates for each Ad shared by that User and, if you are Premium User, each Ad shared by an Introduced User. Each Listing will set out the commission amount payable to Users, an estimate of the number of days until payment is made to Users and any additional conditions for payment applicable to that Listing.</div>\r\n\r\n<div>We shall make payment to a User within [x] days of receiving cleared funds from our Affiliate in respect of the Ad which has been shared by that User. No payment shall be due to a User until we have received cleared funds from our Affiliate.</div>\r\n\r\n<p>We shall not be liable for any taxes, bank charges or currency conversion costs. Any rates and fees quoted on or via our Website exclude any charges a third party service provider (e.g. email provider) may charge.</p>\r\n\r\n<p>We reserve the right to withhold payments if in our reasonable opinion we believe there has been or there is the need to investigate any wrongdoing or breach of these terms.</p>\r\n\r\n<p><strong>Ad Sharing Code Of Conduct</strong></p>\r\n\r\n<p>Users must not share Ads in any way which:</p>\r\n\r\n<ul>\r\n	<li>is likely to deceive any person, impersonate any person or misrepresent your identity or affiliation with any person.</li>\r\n	<li>could be seen as derogatory, defamatory, offensive, prejudicial or infringes the rights of any third party.</li>\r\n	<li>brings us or our Affiliates into disrepute.</li>\r\n	<li>contravenes any social media, email provider or other third party platform&rsquo;s terms of use.</li>\r\n</ul>\r\n\r\n<p>Users should review the review the terms and conditions applicable to their social media accounts, email accounts or any other third party platform accounts where a User wishes to share an Ad. When sharing Ads from our Service Users are responsible for complying with any third party terms of service and agree not to look to us or our Affiliates for the consequences of any breach of third party terms and conditions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Acceptable Use of Our Website </strong></p>\r\n\r\n<p>You may use our Website for lawful purposes only.&nbsp; You may not use the Website:</p>\r\n\r\n<ul>\r\n	<li>In any way that breaches any applicable local, national or international law or regulation.</li>\r\n	<li>In any way that is unlawful or fraudulent, or has any unlawful or fraudulent purpose or effect.</li>\r\n	<li>For the purpose of harming or attempting to harm minors in any way.</li>\r\n	<li>To transmit, or procure the sending of, any unsolicited or unauthorised advertising or promotional material or any other form of similar solicitation (spam).</li>\r\n	<li>To knowingly transmit any data, send or upload any material that contains viruses, Trojan horses, worms, time-bombs, keystroke loggers, spyware, adware or any other harmful programs or similar computer code designed to adversely affect the operation of any computer software or hardware.</li>\r\n</ul>\r\n\r\n<p>You also agree:</p>\r\n\r\n<ul>\r\n	<li>Not to reproduce, duplicate, copy or re-sell any part of the Website in contravention of the provisions of these terms of use.</li>\r\n	<li>Not to access without authority, interfere with, damage or disrupt:\r\n	<ul>\r\n		<li>any part of the Website;</li>\r\n		<li>any equipment or network on which the Website is stored;</li>\r\n		<li>any software used in the provision of the Website; or</li>\r\n		<li>any equipment or network or software owned or used by any third party.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Indemnity</strong></p>\r\n\r\n<p>By using our Website you agree to indemnify and hold us harmless for any loss or damage that occurs as a result of any breach by you of these terms.</p>\r\n\r\n<p><strong>Reporting Issues And Complaints</strong></p>\r\n\r\n<p>Should any issue arise with our Service, Website or an Ad please contact us in the first instance via email or phone [INSERT EMAIL AND NUMBER].</p>\r\n\r\n<p><strong>Accessing the site</strong></p>\r\n\r\n<p>We do not guarantee that the Website, or any content on it, will always be available or be uninterrupted. Access to the Website is permitted on a temporary basis. We may suspend, withdraw, discontinue or change all or any part of the Website without notice. We will not be liable to you if for any reason the Website is unavailable at any time or for any period.</p>\r\n\r\n<p>You are responsible for making all arrangements necessary for you to have access to the Website.</p>\r\n\r\n<p>You are also responsible for ensuring that all persons who access the Website through your internet connection are aware of these terms of use and other applicable terms and conditions, and that they comply with them.</p>\r\n\r\n<p><strong>Intellectual property rights</strong></p>\r\n\r\n<p>We are the owner or the licensee of all intellectual property rights in the Website, and in the material published on it.&nbsp; Those works are protected by copyright laws and treaties around the world. All such rights are reserved. We expressly reserve all rights in and to the&nbsp;www.shareads.co.uk&nbsp;domain name and all related domains and sub-domains,&nbsp;the&nbsp;name &quot;ShareAds&quot;, our logo device, service marks, trading names and/or trade marks and those of our Affiliates.</p>\r\n\r\n<p>Users may print off one copy, and may download extracts, of any page(s) from the Website for Users&rsquo; personal use and Users may draw the attention of others within your organisation to content posted on the Website.</p>\r\n\r\n<p>Users must not modify the paper or digital copies of any materials Users have printed off or downloaded in any way, and you must not use any illustrations, photographs, video or audio sequences or any graphics separately from any accompanying text.</p>\r\n\r\n<p>Our status (and that of any identified contributors) as the authors of content on the Website must always be acknowledged.</p>\r\n\r\n<p>You must not use any part of the content on the Website for commercial purposes without obtaining a licence to do so from us or our licensors.</p>\r\n\r\n<p>If you print off, copy or download any part of the Website in breach of these terms of use, your right to use the Website will cease immediately and you must, at our option, return or destroy any copies of the materials you have made.</p>\r\n\r\n<p><strong>No reliance on information</strong></p>\r\n\r\n<p>The content on the Website is provided for general information only. It is not intended to amount to advice or endorsements on which you should rely. You must obtain professional or specialist advice before taking, or refraining from, any action on the basis of the content on the Website.</p>\r\n\r\n<p>Although we make reasonable efforts to update the information on the Website, we make no representations, warranties or guarantees, whether express or implied, that the content on the Website is accurate, complete or up-to-date.</p>\r\n\r\n<p>We accept no responsibility for content uploaded to the Website by any User or any subsequent information provided by any User. Although we make reasonable efforts to update the information on the Website and ensure that Users do the same, we make no representations, warranties or guarantees, whether express or implied, that the content on the Website is accurate, complete or up-to-date.</p>\r\n\r\n<p><strong>Limitation of our liability</strong></p>\r\n\r\n<p>Nothing in these terms of use excludes or limits our liability for death or personal injury arising from our negligence, or our fraud or fraudulent misrepresentation, or any other liability that cannot be excluded or limited by English law.</p>\r\n\r\n<p>To the extent permitted by law, we exclude all conditions, warranties, representations or other terms which may apply to the Website or any content on it, whether express or implied.</p>\r\n\r\n<p>We will not be liable for any loss, damage or injury arising in connection with any User or any other third party act or omission, including as a result of carrying out or failing to carry out a Task either via our Website or via any other means.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We will not be liable to any User for any loss or damage, whether in contract, tort (including negligence), breach of statutory duty, or otherwise, even if foreseeable, arising under or in connection with:</p>\r\n\r\n<ul>\r\n	<li>use of, or inability to use, the Website; or</li>\r\n	<li>use of or reliance on any content displayed on the Website.</li>\r\n	<li>loss of profits, sales, business, or revenue;</li>\r\n	<li>business interruption;</li>\r\n	<li>loss of anticipated savings;</li>\r\n	<li>loss of business opportunity, goodwill or reputation; or</li>\r\n	<li>any indirect or consequential loss or damage.</li>\r\n</ul>\r\n\r\n<p>We only provide the Website for domestic and private use. You agree not to use the Website for any commercial or business purposes, and that we have no liability to you for any loss of profit, loss of business, business interruption, or loss of business opportunity.</p>\r\n\r\n<p>We will not be liable for any loss or damage caused by a virus, distributed denial-of-service attack, or other technologically harmful material that may infect your computer equipment, computer programs, data or other proprietary material due to your use of the Website or to your downloading of any content on it, or on any website linked to it.</p>\r\n\r\n<p>We assume no responsibility for the content of websites linked on the Website. Such links should not be interpreted as endorsement by us of those linked websites. We will not be liable for any loss or damage that may arise from your use of them.</p>\r\n\r\n<p><strong>Uploading content to the Website</strong></p>\r\n\r\n<p>Any content you upload to the Website will be considered non-confidential and non-proprietary. You retain all of your ownership rights in your content, but you are required to grant us and other users of the Website a limited licence to use, store and copy that content and to distribute and make it available to third parties.</p>\r\n\r\n<p>We also have the right to disclose your identity to any third party who is claiming that any content posted or uploaded by you to the Website constitutes a violation of their intellectual property rights, or of their right to privacy.</p>\r\n\r\n<p>Users agree that information they share with other Users and upload to the Website will be true and accurate.</p>\r\n\r\n<p>Users are not permitted to upload any content which is misleading or fraudulent. Any User found to be using the Website for fraudulent or misleading purposes shall be blocked from the Website and reported to the relevant authorities.</p>\r\n\r\n<p>When you upload or post content to the Website, you grant us a non-exclusive licence to display and distribute the content and use the same for any of our promotional and marketing materials.</p>\r\n\r\n<p><strong>Viruses</strong></p>\r\n\r\n<p>We do not guarantee that the Website will be secure or free from bugs or viruses.</p>\r\n\r\n<p>You are responsible for configuring your information technology, computer programmes and devices in order to access the Website. You should use your own virus protection software.</p>\r\n\r\n<p>You must not misuse the Website by knowingly introducing viruses, trojans, worms, logic bombs or other material which is malicious or technologically harmful. You must not attempt to gain unauthorised access to the Website, the server on which the Website is stored or any server, computer or database connected to the Website. You must not attack the Website via a denial-of-service attack or a distributed denial-of service attack. By breaching this provision, you would commit a criminal offence under the Computer Misuse Act 1990. We will report any such breach to the relevant law enforcement authorities and we will co-operate with those authorities by disclosing your identity to them. In the event of such a breach, your right to use the Website will cease immediately.</p>\r\n\r\n<p><strong>Linking to the Website</strong></p>\r\n\r\n<p>You may link to our Website, provided you do so in a way that is fair and legal and does not damage our reputation or take advantage of it.</p>\r\n\r\n<p>You must not establish a link in such a way as to suggest any form of association, approval or endorsement on our part where none exists.</p>\r\n\r\n<p>You must not establish a link to the Website in any website that is not owned by you.</p>\r\n\r\n<p>The Website must not be framed on any other site.</p>\r\n\r\n<p>We reserve the right to withdraw linking permission without notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Third party links and resources in the Website</strong></p>\r\n\r\n<p>Where the Website contains links to other sites and resources provided by third parties, these links are provided for your information only.</p>\r\n\r\n<p>We have no control over the contents of those sites or resources.</p>\r\n\r\n<p><strong>Suspension and termination</strong></p>\r\n\r\n<p>We will determine, in our discretion, whether there has been a breach of these terms of use.&nbsp; When a breach has occurred, we may take such action as we deem appropriate.&nbsp;</p>\r\n\r\n<p>Breach of these terms of use may result in our taking all or any of the following actions:</p>\r\n\r\n<ul>\r\n	<li>Immediate, temporary or permanent withdrawal of your right to use the Website.</li>\r\n	<li>Immediate, temporary or permanent removal of any posting or material uploaded by you to the Website.</li>\r\n	<li>Issue of a warning to you.</li>\r\n	<li>Legal proceedings against you for reimbursement of all costs on an indemnity basis (including, but not limited to, reasonable administrative and legal costs) resulting from the breach.</li>\r\n	<li>Further legal action against you.</li>\r\n	<li>Disclosure of such information to law enforcement authorities as we reasonably feel is necessary.</li>\r\n</ul>\r\n\r\n<p>We exclude liability for actions taken in response to breaches of this acceptable use policy.&nbsp; The responses described in this policy are not limited, and we may take any other action we reasonably deem appropriate.</p>\r\n\r\n<p><strong>Applicable law</strong></p>\r\n\r\n<p>If you are a consumer, please note that these terms of use, its subject matter and its formation, are governed by English law. You and we both agree to that the courts of England and Wales will have non-exclusive jurisdiction. However, if you are a resident of Northern Ireland you may also bring proceedings in Northern Ireland, and if you are resident of Scotland, you may also bring proceedings in Scotland.</p>\r\n\r\n<p>If you are a business, these terms of use, its subject matter and its formation (and any non-contractual disputes or claims) are governed by English law. We both agree to the exclusive jurisdiction of the courts of England and Wales.</p>\r\n\r\n<p><strong>Contact us</strong></p>\r\n\r\n<p>To contact us, please email <a href=\"http://info@shareads.com\">info@shareads.com</a>&nbsp;</p>\r\n', 1, 0, 0, 0, 1, 'Terms of Use', 'Terms of Use', 1, 0, 0, 1453972656),
(9, 'Privacy Policy', 'privacy-policy', '<p><strong>Privacy Policy:</strong></p>\r\n\r\n<p>ShareAds respects each individual&#39;s right to personal privacy. We will collect and use information through our website only in the ways disclosed in this statement. This statement applies solely to information collected at ShareAds&rsquo;s Website(s). If you choose to use our Service, then you agree to the collection and use of information in relation with this policy. The Personal Information that we collect are used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.</p>\r\n\r\n<p><strong>Personal Information:</strong></p>\r\n\r\n<p>For a better experience while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to your name, phone number, and postal address. The information that we collect will be used to contact or identify you.</p>\r\n\r\n<p><strong>Log Data:</strong></p>\r\n\r\n<p>We want to inform you that whenever you visit our Service, we collect information that your browser sends to us that is called Log Data. This Log Data may include information such as your computer&rsquo;s Internet Protocol (IP) address, browser version, pages of our Service that you visit, the time and date of your visit, the time spent on those pages, and other statistics.</p>\r\n\r\n<p><strong>Changes to This Privacy Policy:</strong></p>\r\n\r\n<p>We may update our Privacy Policy from time to time. Thus, we advise you to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately, after they are posted on this page.&nbsp;</p>\r\n', 1, 0, 0, 0, 1, 'Meta Keywords', 'Meta Description', 1, 0, 0, 1453972827),
(10, 'Information', 'information', '<p>www.shareads.com&nbsp;is a site operated by Biz Mi Limited (&quot;We&quot;). We are registered in England and Wales under company number 09378935 and have our registered office at 1st Floor 2 Woodberry Grove, Finchley, London, N12 0DR.</p>\r\n', 1, 0, 0, 0, 0, '', '', 1, 0, 0, 1456127071),
(15, 'Owners Guide', 'owners-guide', '', 0, 0, 0, 0, 0, 'Meta Keywords', 'Meta Description', 1, 0, 0, 1461048703),
(18, 'About Share Ads', 'about-share-ads', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', 1, 0, 0, 1, 0, 'Meta Keywords', 'Meta Description', 0, 2, 2, 1465204995),
(19, 'About Us', 'about-us', '<p>ShareAds is an affiliate marketing software where there will be 2 types of users that can join. One is <strong>Publisher</strong> and other one is <strong>Advertiser</strong>. If we talk about publisher in brief, ShareAds deliver best results since we have top advertisers, the right advertisements, the best technology and consultative approach. ShareAds offers a unique opportunity to earn money by promoting and endorsing various products and services. You simply share a link to an ad via Facebook or tweet via Twitter to your friends or followers.</p>\r\n\r\n<p>www.shareads.com&nbsp;is a site operated by Biz Mi Limited (&quot;We&quot;). We are registered in England and Wales under company number 09378935 and have our registered office at 1st Floor 2 Woodberry Grove, Finchley, London, N12 0DR.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 0, 0, 1, 0, 'Meta Keywords', 'Meta Description', 1, 0, 1, 1465205022),
(21, 'FAQs', 'faqs', '<style type=\"text/css\">.faq-tabs-pill .tab-content{margin: 20px 0 70px 0;}\r\n.faq-tabs-pill .nav-tabs>li>a {color: #2b4761;font-weight: 600;}\r\n.faq-tabs-pill .nav-tabs>li.active>a, .nav-tabs>li.active>a:focus, .nav-tabs>li.active>a:hover {color: #fff;cursor: pointer;background-color: #8ac228;}\r\n.faq-tabs-pill .tab-content .tab-pane p>a:hover{color: #8ac228;}\r\n</style>\r\n<div class=\"faq-tabs-pill\">\r\n<ul class=\"nav nav-tabs\">\r\n	<li class=\"active\"><a href=\"#advertiser\">Advertisers</a></li>\r\n	<li><a href=\"#publisher\">Publishers</a></li>\r\n</ul>\r\n\r\n<div class=\"tab-content\">\r\n<div class=\"tab-pane fade in active\" id=\"advertiser\">\r\n<p><strong>Q1. What is an advertiser?</strong><br />\r\nAnyone with an advertiser account on ShareAds is Advertiser. Advertisers will share the Ads to earn their commission.</p>\r\n\r\n<p><strong>Q2. How to become an advertiser?</strong><br />\r\nCreate an advertiser account on ShareAds to become an advertiser and start earning today.</p>\r\n\r\n<p><strong>Q3. Do I have to pay to become a member?</strong><br />\r\nNo, to be a member of ShareAds there is no registration fee or hidden charges. It is completely free.</p>\r\n\r\n<p><strong>Q4. How to get shareable ads of products?</strong><br />\r\nIn advertiser account, you will see the tab of Share Ads. You can use this tab to find and share the Ads.</p>\r\n\r\n<p><strong>Q5. What products do I promote?</strong><br />\r\nWe work with reputable businesses of all sizes. As an advertiser, you will have to share the Ads of these businesses.</p>\r\n\r\n<p><strong>Q6. How can advertiser earn commission by sharing the ads?</strong><br />\r\nEvery product has a specific link; if someone buys the product from your shared link you will earn the commission of that Product.</p>\r\n\r\n<p><strong>Q7. Which platforms advertiser can use to share the ads?</strong><br />\r\nAs an advertiser you can use different platforms like Facebook, Twitter or LinkedIn etc to share the product Ads of Publishers.</p>\r\n\r\n<p><strong>Q8. How often do I share the ads?</strong><br />\r\nWe ask you to share just twice per day between 9 am and 12 pm and after 5 pm and 12 am.</p>\r\n\r\n<p><strong>Q9. Do I need to write anything when I share?</strong><br />\r\nNo, this is optional but you can make the comments while sharing the product Ad.</p>\r\n\r\n<p><strong>Q10. How an advertiser can see the reports of their ads?</strong><br />\r\nIn advertiser account, you will see the tab of Reporting. You can use this tab to view the report of sales and shared links.</p>\r\n\r\n<p><strong>Q11. How the earning process will work?</strong><br />\r\nThe publisher will confirm the sale if someone buys some product from your shared link. After confirmation, you will have your commission in your wallet.</p>\r\n\r\n<p><strong>Q12. When the advertiser will get the commission?</strong><br />\r\nThe advertiser will have the commission after 40 days of the sales in his/her wallet.</p>\r\n\r\n<p><strong>Q13. How do I get paid?</strong><br />\r\nYou can use the PayPal or Wire Transfers to withdraw your commission from your wallet.</p>\r\n\r\n<p><strong>Q14. What is the minimum amount an advertiser can withdraw?</strong><br />\r\nThe minimum requirement to withdraw the amount is $20, &pound;20 etc. we currently offering the commission only in Dollars and Pounds.</p>\r\n\r\n<p><strong>Q15. How quickly can I start?</strong><br />\r\nAs soon as you sign up you can start.</p>\r\n\r\n<p><strong>Q16. Can an Advertiser be a Publisher?</strong><br />\r\nYes! An advertiser can be a publisher by using different login credentials.</p>\r\n</div>\r\n\r\n<div class=\"tab-pane fade\" id=\"publisher\">\r\n<p><strong>Q1. What is a Publisher?</strong><br />\r\nA publisher can be a business or product owner that will post his/her products on ShareAds platform under some decided commission.</p>\r\n\r\n<p><strong>Q2. How to become a Publisher?</strong><br />\r\nCreate a Publisher account on ShareAds to become a Publisher and start posting your products for promotion.</p>\r\n\r\n<p><strong>Q3. How to add a new Product?</strong><br />\r\nIn the Publisher Account, you can add a new product using the Products section.</p>\r\n\r\n<p><strong>Q4. How a Publisher can activate his/her product?</strong><br />\r\nInstructions are given in the support document please check it out to activate your account. You just have to add our script to your website. <a href=\"https://www.shareads.com/uploads/adding_listing.pdf\" target=\"_blank\"><b>Instructions Link</b></a></p>\r\n\r\n<p><strong>Q5. How a Publisher can edit the Product?</strong><br />\r\nYou can edit your product from the products Section. In the product section you will see the products list just click on the edit button and edit your product.</p>\r\n\r\n<p><strong>Q7. Who can view and share Publisher&rsquo;s product?</strong><br />\r\nAdvertiser&hellip; we have a big list of happy advertisers that will share your products.</p>\r\n\r\n<p><strong>Q8. On which platform Publisher&rsquo;s product will be shared?</strong><br />\r\nThe advertiser can use different platforms like Facebook, Twitter or LinkedIn etc to share your product Ads.</p>\r\n\r\n<p><strong>Q9. How the sales process will work?</strong><br />\r\nYou will get the update on your account once the sale of your product is confirmed. You can check the sales status on your account.</p>\r\n\r\n<p><strong>Q10. How a Publisher can manage the Sales Confirmation?</strong><br />\r\nThe publisher can confirm or unconfirmed the Sales Status from the view section of Products.</p>\r\n\r\n<p><strong>Q11. How a Publisher can see the reports of their Products Ad?</strong><br />\r\nIn Publisher account, you will see the tab of Reporting. You can use this tab to view the report of sales and shared links.</p>\r\n\r\n<p><strong>Q12. When the publisher will have to pay the sales commission?</strong><br />\r\nYou will have the sales invoice monthly or biweekly and you can pay the amount within 8 days.</p>\r\n\r\n<p><strong>Q13. What amount the Publisher will pay to ShareAds?</strong><br />\r\nAs per ShareAds Policy, the fixed amount will be deducted by the ShareAds on every sale.</p>\r\n\r\n<p><strong>Q14. Do I have to pay any extra Amount to ShareAds?</strong><br />\r\nNo, ShareAds will never charge any extra amount from the publisher and there are no hidden charges as well.</p>\r\n\r\n<p><strong>Q15. How a Publisher can view the sales invoices?</strong><br />\r\nA publisher can view and download all the sale invoices from the Invoice section in the Publisher account.</p>\r\n\r\n<p><strong>Q16. When the invoice will generate for a Publisher?</strong><br />\r\nThe sales invoices for the publisher will be generated monthly or biweekly.</p>\r\n\r\n<p><strong>Q17. How a publisher can update the Invoice duration?</strong><br />\r\nFor the publisher ease, in the profile settings Publisher can choose the monthly or biweekly option for the invoice payment.</p>\r\n\r\n<p><strong>Q18. How a publisher can pay his/her invoices?</strong><br />\r\nA publisher will pay his entire invoices through PayPal.</p>\r\n\r\n<p><strong>Q19. How quickly a Publisher can start?</strong><br />\r\nAs soon as you sign up you can start.</p>\r\n\r\n<p><strong>Q20. Can a Publisher be an Advertiser?</strong><br />\r\nYes! A publisher can be an advertiser by using different login credentials.</p>\r\n\r\n<p><strong>Q21. How the Publisher will set his Product Commission?</strong><br />\r\nWhile adding a new product the publisher can set the product commission as per his/her choice.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<script>\r\n	$(document).ready(function(){$(\".nav-tabs a\").click(function(){$(this).tab(\'show\');});});\r\n</script>', 1, 0, 1, 0, 1, ' (Check if you want to make it master page)', ' (Check if you want to make it master page)', 1, 0, 0, 1468563616),
(22, 'Advertiser', 'advertiser', '<style type=\"text/css\">.center, .center p{margin-bottom:20px;}\r\n</style>\r\n<h4 id=\"docs-internal-guid-6a4a12cc-0202-cc48-c63d-68242298d774\">Reach your customer in the right place at the right time</h4>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><strong>Targeting</strong></p>\r\n\r\n<p dir=\"ltr\">Finding a needle in a haystack is a difficult task.Somewhere among the millions of internet users is your ideal audience. The question is: How do you find them? Funny you should ask. Shareads has a comprehensive set of targeting tools capable of connecting you with precisely the consumers you&#39;re after.</p>\r\n\r\n<p dir=\"ltr\">Target users based on their displayed behaviors online.</p>\r\n\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Audience Behaviors (traditional behavioral targeting):</strong>&nbsp;Hundreds of audience behavior segments are available for targeting (e.g., Auto Intenders, Apparel Shoppers, Family Planners, Travelers, Investors, Health Seekers, Trendy Homemakers, Moviegoers and more).</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Custom Audience Behaviors:</strong> Target a custom segment of users who have displayed relevant, discrete behaviors such as site visitation and buying habits across various content categories.</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Audience Extensions:</strong> With an audience extension, you can reach those same users wherever they go across affiliate marketing network - at a lower CPM than running ads on one site alone.</p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Search Behaviors:</strong> Target users who have made category-related searches on properties or third party sites(e.g. auto, diet &amp; fitness, real estate, shopping, travel, and more).</p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><strong>Technographic</strong></p>\r\n\r\n<p dir=\"ltr\">You can tell a lot about a user from the type of technology they use frequently. It is quite handly, actually. Target users based on technology elements from a user&rsquo;s computer or the network they use to access the internet for e.g. top-level Domain, Full Domain, Connection Speed, Browser and Operating Speed.</p>\r\n\r\n<p dir=\"ltr\"><strong>Demographic</strong></p>\r\n\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>User/Household:</strong> You can target users based on attributes from user registration or third-party data (e.g. age, gender, income, kids).</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Site:</strong> Place your ads on the sites that are visited most frequently by your desired audience. We aggregate our inventory by demographic and psychographic attributes.You can, for example, place your ad on sites that are visited by users who attended college, users who applied offline for a credit card in the last six months, user who traveled domestically over six &nbsp;times in the last six months, and many more.</p>\r\n', 1, 0, 1, 0, 1, 'advertiser', 'publisher', 1, 0, 0, 1468835692),
(23, 'Publisher', 'publisher', '<style type=\"text/css\">.center, .center p{margin-bottom:20px;}\r\n</style>\r\n<h4 dir=\"ltr\" id=\"docs-internal-guid-6e827dbe-0290-4bd5-a576-4945a75b73dd\">The smart choice for publishers, stop seeing other networks</h4>\r\n<p dir=\"ltr\"></p>\r\n<p dir=\"ltr\">Well you have spent a lot of time making your site everything it is. It&#39;s engaging and interactive yet never found something special. Sure your site might have seen other networks these days but had never worked out, maybe because of poor advertisement quality or poor service. We deliver best results since we have top advertisers, the right advertisements, the best technology and consultative approach. ShareAds offers a unique opportunity to earn money by promoting and recommending various products and services. You simply share a link to an ad via Facebook or retweet via Twitter to your friends or followers.</p>\r\n<p dir=\"ltr\"><strong>Top advertisers</strong></p>\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">The shareads network roster is unmatched and includes the biggest and best brand names in the industry. &nbsp;If you&rsquo;re seeking for a skillful set of advertisers, then you are at the right place we offer ad blocks by advertiser, industry, media, and category to ensure the best fit for your site.</p>\r\n	</li>\r\n</ul>\r\n<p dir=\"ltr\"><strong>The right ads</strong></p>\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Ads should fit with your site, have relevance to your reader, and pay you appropriately. We care about your site, which is why we won&#39;t cheapen its appearance or reputation with poor quality ads. &nbsp;We care about your visitors, too. How they respond to the ads we deliver makes all the difference.</p>\r\n	</li>\r\n</ul>\r\n<p dir=\"ltr\"><strong>The best technology</strong></p>\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Our mission is simple: make technology an asset for your business not a problem. Too many times we have seen other IT consulting firms recommend solutions that are not appropriate for the specific client&#39;s business or will not take a business&#39; operations into their planning as they routinely bring down an entire business while they perform routine maintenance on a server. That is unacceptable. We won&#39;t bring you down in the middle of the day because it is &quot;a better time for us&quot;. We work around your business. We strive to make technology integrate seamlessly with your business so your business can grow. As your technology partner, when your business grows ours will grow with you, therefore, we will work hand in hand with you to support your growth.</p>\r\n	</li>\r\n</ul>\r\n<p dir=\"ltr\"><strong>Consultative approach</strong></p>\r\n<ul style=\"margin-top:0pt;margin-bottom:0pt;\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\">Whether you are seeking for a network where you can grow your business more or you&rsquo;re seeking general guidance or complex, custom analysis, our team is at your disposal. &nbsp;With over a decade of experience and thousands of sites in our network, we know how to help you get the most from your site.</p>\r\n	</li>\r\n</ul>\r\n<p>Being a publisher you will have access to set the commissions that you wanted the advertisers to earn by marketing your product. Later on you can get the total account summary that will be provided showing you total number of your products, the visitors that would be viewing your product on your site URL, total sales being made and the commission that have been paid. Graphically detailed view will be provided to give explicit summary of your product;s sales.</p>', 1, 0, 1, 0, 1, 'Publisher', 'Publisher', 1, 0, 0, 1468836285),
(24, 'Cookie Policy', 'cookie-policy', '<p><strong>Cookie Policy:</strong></p>\r\n\r\n<p>Cookies are files with small amount of data that is commonly used an anonymous unique identifier. These are sent to your browser from the website that you visit and are stored on your computer&rsquo;s hard drive. Our website uses these &ldquo;cookies&rdquo; to collection information and to improve our Service. You have the option to either accept or refuse these cookies, and know when a cookie is being sent to your computer. If you choose to refuse, you may not be able to use some portions of our Service.</p>\r\n', 1, 0, 0, 0, 1, 'Cookie Policy', 'Cookie Policy', 1, 0, 0, 1502190428),
(25, 'Welcome Content', 'welcome-content', '<p avenir=\"\" style=\"box-sizing: border-box; padding: 0px; margin: 0px 0px 20px; transition: all 0.35s ease 0s; outline: none; font-size: 18px; text-align: justify; color: rgb(43, 71, 97); font-family: \">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p avenir=\"\" style=\"box-sizing: border-box; padding: 0px; margin: 0px 0px 20px; transition: all 0.35s ease 0s; outline: none; font-size: 18px; text-align: justify; color: rgb(43, 71, 97); font-family: \">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://shareads.arhamsoft.com/dashboard\">Go To Dashboard</a></p>\r\n', 1, 0, 0, 0, 0, '', '', 1, 0, 0, 1552386079);
