(1, 1, 1, '2016-01-28 14:12:53', 'Welcome to ShareAds!', '<p style=\"text-align: left;\">Thanks for signing up with ShareAds!</p>\r\n\r\n<p style=\"text-align: left;\">It is a pleasure for us to welcome you for joining our affiliate marketing Platform. We are hopeful that you will be excited when you discover amazing possibilities. You will enjoy working as our team member.</p>\r\n\r\n<p style=\"text-align: left;\">We are always open to innovative ideas and you can share your ideas for the betterment in our teamwork. Looking forward to a more strong and profitable affiliation.</p>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\" text-align: center;\">\r\n			<td>\r\n			<ul style=\"text-align: center; padding: 0; display: block;\">\r\n				<li>[SOCIAL_LINKS]</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Welcome to ShareAds!'),
(2, 2, 1, '2016-01-28 14:14:48', 'Forgot Your Password', '<h1 style=\"font-family: Avenir, Helvetica, sans-serif; box-sizing: border-box; color: rgb(47, 49, 51); font-size: 19px; font-weight: bold; margin-top: 0px; text-align: left;\">&nbsp;</h1>\r\n\r\n<p style=\"font-family: Avenir, Helvetica, sans-serif; box-sizing: border-box; color: rgb(116, 120, 126); font-size: 16px; line-height: 1.5em; margin-top: 0px; text-align: left;\">You are receiving this email because we&#39;ve received a password reset request for your account.</p>\r\n\r\n<p style=\"font-family: Avenir, Helvetica, sans-serif; box-sizing: border-box; color: rgb(116, 120, 126); font-size: 16px; line-height: 1.5em; margin-top: 0px; text-align: left;\">&nbsp;</p>\r\n\r\n<p style=\"font-family: Avenir, Helvetica, sans-serif; box-sizing: border-box; color: rgb(116, 120, 126); font-size: 16px; line-height: 1.5em; margin-top: 0px; text-align: left;\">&nbsp;</p>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\" text-align: center;\">\r\n			<td>\r\n			<ul style=\"text-align: center; padding: 0; display: block;\">\r\n				<li>[SOCIAL_LINKS]</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', ''),
(3, 3, 1, '2016-01-28 14:14:56', 'ShareAds Feedback', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td valign=\"top\">\r\n			<p>Thank you for sharing your precious&nbsp;Feedback with ShareAds. We hope you&#39;ll keep us in mind for your future subscriptions.</p>\r\n\r\n			<p>If you still need help, please contact us.</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\" text-align: center;\">\r\n			<td>\r\n			<ul style=\"text-align: center; padding: 0; display: block;\">\r\n				<li>[SOCIAL_LINKS]</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', ''),
