(8, 6, 1, '2016-06-25 11:24:17', 'Welcome to ShareAds', '<p style=\"color:#005a31;font-size:15px;margin-top:50px\"><strong>Have Queries?</strong></p>\r\n\r\n<p>Feel free to <span class=\"il\">contact</span> <span class=\"il\">us</span> at:&nbsp;</p>\r\n\r\n<p>Hybrid Marketing Inc 4730 S.<br />\r\nFort Apache Road, Suite 300,<br />\r\nLas Vegas, NV 89147<br />\r\n<u><a href=\"mailto:info@shareads.co.uk\"><span style=\"color:#0000FF;\">info@sharead</span></a><span style=\"color:#0000FF;\">s.com</span></u></p>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\" text-align: center;\">\r\n			<td>\r\n			<ul style=\"text-align: center; padding: 0; display: block;\">\r\n				<li>[SOCIAL_LINKS]</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', ''),
(9, 9, 1, '2016-06-25 11:26:19', 'Registration Confirmation Email', '<p>This email is to notify you that your registration application as our new team member has been received. Your application has been processed and approved. Now, you are our registered team member.</p>\r\n\r\n<p>The generated registration number is unique and you will not be allowed to change, alter or exchange with other team members. We thank you for registering in our affiliate program. We hope that you will find our program more interesting and profitable.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\" text-align: center;\">\r\n			<td>\r\n			<ul style=\"text-align: center; padding: 0; display: block;\">\r\n                 [SOCIAL_LINKS]\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', ''),
(12, 10, 1, '2018-08-28 08:08:51', 'Welcome to ShareAds', '<p style=\"text-align: left;\">We ShareAds, warmly welcome you to market your product with us. We are one of the finest Ad sharing organizations. By marketing your product with ShareAds you will get the best Affiliates and Marketers around the globe for your business and products that will boost your sale and profit.</p>\r\n\r\n<p style=\"text-align: left;\">By joining the ShareAds you will get a strong increment in your business as we share your products on social media platforms via our advertisers. Our team is really happy sending you the invitation to join the ShareAds organization as Publisher.</p>\r\n\r\n<p style=\"text-align: left;\">Joining ShareAds is very easy. Click on the following link to start publishing your products via ShareAds.</p>\r\n', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: left;\">We are looking forward to you joining the ShareAds and being part of this organization. If you have any questions, please do not hesitate and contact us at</p>\r\n\r\n			<p style=\"text-align: left;\">Contact us:&nbsp;<a href=\"https://www.shareads.com/pages/contact-us\">https://www.shareads.com/pages/contact-us</a></p>\r\n\r\n			<p>Best regards,</p>\r\n\r\n			<p>Customer support team<br />\r\n			shareads.com</p>\r\n\r\n			<p>ShareAds sent this message to you. ShareAds is committed to your privacy. Learn more about our <a href=\"https://www.shareads.com/pages/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://www.shareads.com/pages/terms-of-use\" target=\"_blank\">Terms and Conditions</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr align=\"center\" style=\"text-align: center;\">\r\n			<td>\r\n			<ul style=\"padding: 0px; text-align: center; display: block;\">\r\n				<li>[SOCIAL_LINKS]</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\">&copy; 2018&nbsp;ShareAds All rights reserved.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', ''),
