(3, 'How to Create Advertiser Account via Email on ShareAds?', 'how_to_create_advertiser_account_via_email_on_shareads?', '<p>This article will show you how to create an Advertiser Account. Follow these simple steps and set up your Account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Advertiser Account</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Go to www.ShareAds.com/login</li>\r\n	<li>You will find an option Create Account</li>\r\n	<li>You will get a Signup Form; enter Your First Name, Last Name, and Email Address</li>\r\n	<li>Click on Sign Up</li>\r\n	<li>You will get a Welcome Email with Login and Password Details</li>\r\n	<li>Enter this Email and Password in the Login Form</li>\r\n	<li>Click on Login.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554032, 1540794763),
(4, 'How to Create ShareAds Account via Social Media Platforms (Facebook/Twitter)?', 'how_to_create_shareads_account_via_social_media_platforms_(facebook/twitter)', '<p>This article will show how to create the advertiser Account via Social Media accounts like Facebook or Twitter.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Advertiser Account via Social Media Platforms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Go to www.ShareAds.com/login</li>\r\n	<li>You will find Facebook and Twitter button in the login form</li>\r\n	<li>Click on Facebook or Twitter</li>\r\n	<li>&nbsp;You will get a Pop-up Screen</li>\r\n	<li>Enter login and Password of your Social Media Account and click on Login</li>\r\n	<li>You will get another Pop-up screen (for Example Continue With John)</li>\r\n	<li>&nbsp;Click on it and your account will be created</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554137, 1540794744),
(5, 'How get New Password if you forgot your Password?', 'how_get_new_password_if_you_forgot_your_password?', '<p>This article will show you how to get a new password if you forgot your Advertiser of Publisher Account Password.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Forgot Password </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Go to www.ShareAds.com/login</li>\r\n	<li>You will get a Login form</li>\r\n	<li>&nbsp;You will find an option of Forgot Password, click on it</li>\r\n	<li>Enter your Account Email and Click on Submit Request You will get an Email from the Customer Support team of ShareAds with login and new Password</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554213, 1540794729),
(6, 'How to Change Password of your Account?', 'how_to_change_password_of_your_account?', '<p>This article will show you how to Change the Password of your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Change Password </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account</li>\r\n	<li>&nbsp;You will find a Navigation bar</li>\r\n	<li>&nbsp;Next, to Reporting, you will find Profile Settings, click on it</li>\r\n	<li>In Profile Settings, you will find an option of Change Password</li>\r\n	<li>Click on Change Password and Enter your Old Password, New Password and Confirm your New Password</li>\r\n	<li>&nbsp;Click on Update Password</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554289, 1540794712),
(7, 'How to Update the Profile of your ShareAds Account?', 'how_to_update_the_profile_of_your_shareads_account?', '<p>This article will show you how to update the profile of your ShareAds Account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Update Profile</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account. You will find a Navigation bar</li>\r\n	<li>Next to Reporting, you will find Profile Settings, click on it</li>\r\n	<li>In Profile Settings you will find an option Edit Profile.</li>\r\n	<li>Click on Edit Profile</li>\r\n	<li>You will find three sections here Edit Information, Phone No and Location and Payment Settings</li>\r\n	<li>In the Phone No and Location you will find an option Choose File. Click on it to change your Profile Picture</li>\r\n	<li>In the Payment Settings, check the PayPal option and enter your PayPal Email</li>\r\n	<li>For Wire Transfer check the Wire Transfer and enter the required details</li>\r\n	<li>Click on the Update Profile</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></p>\r\n', 1, 1540554355, 1540794695),
(8, 'How to view the Account Summary of your ShareAds Account?', 'how_to_view_the_account_summary_of_your_shareads_account?', '<p>This article will show you how to view the Reporting of your ShareAds Account. In this section you can view the Total Links Shared, Total Visitors, Total Successful Sales, Total Commission Earned and Total Unsuccessful Commission.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Reporting&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account. You will find a Navigation bar</li>\r\n	<li>Next to ShareAds, you will find Reporting</li>\r\n	<li>Click on Reporting</li>\r\n	<li>In Reporting, you will see the options of Today, Last 7 days, 30 days, 6 Months, 1 year and Custom Date</li>\r\n	<li>Click on any of these options to View the Account Summary</li>\r\n	<li>Click on the Custom date, enter the date of which you want to see the Account Summary and click n Go.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong>&nbsp;</p>\r\n', 1, 1540554448, 1540794677),
(9, 'How to View the Detail Summary of Your ShareAds Account?', 'how_to_view_the_detail_summary_of_your_shareads_account?', '<p>This article will show you how to view the Details of your Account Summary.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>View Details of Account Summary</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Advertiser Account. You will find a Navigation bar</li>\r\n	<li>&nbsp;Next to ShareAds, you will find Reporting</li>\r\n	<li>Click on Reporting</li>\r\n	<li>You will find an option of View Detail just below the Account Summary</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Click on View Detail If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 1540554591, 1540794661),
(10, 'How to View the total Sales and Total Commission Earned?', 'how_to_view_the_total_sales_and_total_commission_earned?', '<p>This article will help you how to view the total sales and total commissioned earned for the current month.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Total Sales/Total Commission</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Advertiser Account. You will find a Navigation bar</li>\r\n	<li>In Navigation, you will see the option of Dashboard</li>\r\n	<li>Click on Dashboard</li>\r\n	<li>In the Dashboard, you will the Total Account Summary</li>\r\n	<li>Here you can see your Total Sales and Total Commission Earned for the current month</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554679, 1540794643),
(11, 'How to find the Product of your choice using ShareAds Account?', 'how_to_find_the_product_of_your_choice_using_shareads_account?', '<p>This article will show you how to find a product you are interested in and share it using the social media icons or copy the unique links.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1:<strong> Find and Share Ads</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account. You will find a Navigation bar</li>\r\n	<li>Next to Dashboard you will find Share Ads. Click on it</li>\r\n	<li>You will find Categories on the left side of Share Ads Section</li>\r\n	<li>Choose and click the Category of your Choice 5. Just after the Categories Section you will see the option of Find Products</li>\r\n	<li>In the Search Bar, you can Search the Product of your Choice</li>\r\n	<li>In Find Products you will see the options of All Categories, Most Popular, Highest Paying and Lowest Paying</li>\r\n	<li>You can select anyone from these options and click on Go.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554735, 1540794623),
(12, 'How to do the Advance Search with your ShareAds Account?', 'how_to_do_the_advance_search_with_your_shareads_account?', '<p>This article will show you how to do the advance Search for finding the product of your choice with some special checks.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Advanced</strong><strong> Search</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account. You will find a Navigation bar</li>\r\n	<li>Next, to the Dashboard, you will find Share Ads. Click on it</li>\r\n	<li>In Share Ads, you will see Find Products. In Find Products you will see an option of Advanced Search. Click on it.</li>\r\n	<li>In Advance Search you will see three section of Keywords, Stats and Product Type You can use these sections to find the product that suits you.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong>.</p>\r\n', 1, 1540554805, 1540794605),
(13, 'How to share the Ads via Social Media Platforms?', 'how_to_share_the_ads_via_social_media_platforms?', '<p>In this article, you will learn how to share the ads via emails or by different social media platforms like Facebook, Twitter or LinkedIn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Share the Ad</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account. You will find a Navigation bar</li>\r\n	<li>Next, to the Dashboard, you will find Share Ads. Click on it</li>\r\n	<li>In Share Ad, you will find options like Facebook, Tweet, Email, Copy Link and LinkedIn under each Ad.</li>\r\n	<li>You can use any of these Social media platforms or Email to Share the Ad link.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554867, 1540794583),
(14, 'How to check the Balance in ShareAds Account?', 'how_to_check_the_balance_in_shareads_account?', '<p>This article will show you how to view the current balance in your account. You will also know how to withdraw the amount from ShareAds account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Balance/Withdraw Amount </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Account.</li>\r\n	<li>In the top right corner click on your profile picture icon</li>\r\n	<li>You will see a drop down list here</li>\r\n	<li>Click on Wallet</li>\r\n	<li>In the Wallet you can see your Current Balance</li>\r\n	<li>Just after the Current balance you will see the option of Request Withdraw</li>\r\n	<li>&nbsp;Just below the My Wallet you will see the Withdraw History option</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Note:</strong> Your Minimum Withdraw amount will be as per ShareAds Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540554935, 1540794563),
(15, 'How to Create a Publisher Account on ShareAds?', 'how_to_create_a_publisher_account_on_shareads?', '<p>This article will show you how to create a Publisher Account on ShareAds. To create a Publisher Account follow these steps</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Publisher Account </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Go to www.shareads.com/register/publisher</li>\r\n	<li>You will find a Publisher Sign up form Enter Your First Name, Last Name, and Email</li>\r\n	<li>Click on Sign up</li>\r\n	<li>You will get a Confirmation Message of submitted Account in the top left corner. You will get a Confirmation email with Login and Password when your Account gets Approval or Activated</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555035, 1540794477),
(16, 'How to View the total Sales and Total Commission Paid?', 'how_to_view_the_total_sales_and_total_commission_paid?', '<p>This article will help you how to view the total sales and total commissioned Paid for the current month.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Total Sales/Total Commission Paid </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>In Navigation, you will see the option of Dashboard</li>\r\n	<li>Click on Dashboard</li>\r\n	<li>In the Dashboard, you will the Total Account Summary</li>\r\n	<li>Here you can see your Total Sales and Total Commission Paid for the current month</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555098, 1540794457),
(17, 'How to View the Detail Summary of Your ShareAds Account?', 'how_to_view_the_detail_summary_of_your_shareads_account?', '<p>This article will show you how to view the Details of your Account Summary</p>\r\n\r\n<p>.</p>\r\n\r\n<p>Step 1: <strong>View Details of Account Summary </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next, to ShareAds, you will find Reporting</li>\r\n	<li>Click on Reporting</li>\r\n	<li>You will find an option of View Detail just below the Account Summary</li>\r\n	<li>Click on View Detail</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555152, 1540794438),
(18, 'How to set the Biweekly and Monthly Payment Settings?', 'how_to_set_the_biweekly_and_monthly_payment_settings?', '<p>This article will show you how the publisher can set biweekly and Monthly Payment setting.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Payment Settings </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next to Products, you will find Profile Settings</li>\r\n	<li>In Profile Settings you will see the Payment Settings Section</li>\r\n	<li>In Payment Settings enter your PayPal Email</li>\r\n	<li>Just after the PayPal Email you will see Payment Schedule</li>\r\n	<li>In Payment Schedule you will Biweekly and Monthly Checks</li>\r\n	<li>Click your Desired option 8. Click on Update profile</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555209, 1540794416),
(19, 'How to Add New Product in ShareAds Account?', 'how_to_add_new_product_in_shareads_account?', '<p>In this Article you will learn how to add a new product so that Advertiser can search for your product in the search bar and share it easily.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>New Products</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>&nbsp;Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next to Dashboard, you will find Products</li>\r\n	<li>Click on Products</li>\r\n	<li>In Products, you will see an option of Add New</li>\r\n	<li>Click on Add new</li>\r\n	<li>You will find four sections Categories and Product Type, Title &amp; Listing Details, Description and Listing Details and Product Images Enter the details in these sections and click on Submit</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our&nbsp;<strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555355, 1540811757),
(20, 'How to Unconfirm the Sale Status in ShareAds Account?', 'how_to_unconfirm_the_sale_status_in_shareads_account?', '<p>This article will show you how can you unconfirmed the Sale Status if you have any doubt about the sale.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Status Confirmation </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next to Dashboard, you will find Products</li>\r\n	<li>Click on Products</li>\r\n	<li>In the Products list you will find the option of Commission Info</li>\r\n	<li>Click on Commission Info</li>\r\n	<li>In the commission info you will find Toggle Button</li>\r\n	<li>Set the Toggle button to Unconfirm if you have any doubt on the Sales</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555425, 1540794380),
(21, 'How to view or Download the Invoices on ShareAds Account?', 'how_to_view_or_download_the_invoices_on_shareads_account?', '<p>In this article you will learn how to view the generate invoices and how can you download these invoices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Invoices </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next to Profile Settings, you will find Invoices</li>\r\n	<li>Click on Invoices</li>\r\n	<li>In Invoices you will see two options Download and View</li>\r\n	<li>To download the Invoice click on Download</li>\r\n	<li>Click on View to View the Status of your Invoice</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555472, 1540794362),
(22, 'How to Pay the Invoice to ShareAds?', 'how_to_pay_the_invoice_to_shareads?', '<p>This article will show you how to pay the Invoices to ShareAds via PayPal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Step 1: <strong>Pay Invoice</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>&nbsp;Login to your ShareAds Publisher Account. You will find a Navigation bar</li>\r\n	<li>Next to Profile Settings, you will find Invoices</li>\r\n	<li>Click on Invoices</li>\r\n	<li>In Invoices you will see two options Download and View</li>\r\n	<li>To download the Invoice click on Download</li>\r\n	<li>Click on View to View the Status of your Invoice</li>\r\n	<li>In view you will see an option of Pay Invoice</li>\r\n	<li>Click on Pay Invoice</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you still experience any issue, Contact with our <strong><a href=\"javascript:$zopim.livechat.window.show();\"><strong>Customer Support Team.</strong></a></strong></p>\r\n', 1, 1540555519, 1540794112);
