(13, 1, 3, 'Payment protection insurance', 'payment-protection-insurance-13', 0, 4, '3,4', 'No Win No Fee (PPI)', 'With no obligation Allay will lookout any payment protection insurance you had in the past without any charges. It is completely free as we have a focused and dedicated team that will do all the hard work for you.\r\n', '', 1, 2, 'https://allayppi.com/', NULL, 'http://bit.ly/2NWsVHg', 1, 0, 0, 1538479629, 0, 1, 0),
(14, 1, 3, 'Pay Day Claims ', 'pay-day-claims-14', 0, 4, '3,4', 'Claim for any compensation', 'We dont think that claiming compensation needs to be difficult so the motive of Payday claims is to keep the claiming process simple and straightforward as we can. We just need some details from your side to start the claim.\r\n', '', 1, 2, 'http://paydayloanclaim.org.uk/', 'https://paydayloanclaim.org.uk/thankYou.html', 'http://bit.ly/2O0TvyX', 1, 0, 0, 1538479770, 0, 1, 0),
(15, 1, 3, 'Nationwide Debt Help', 'nationwide-debt-help-15', 0, 4, '3,4', 'Start your IVA application', 'Nationwide debt help is providing you a solution to all your problems. You can contact us at our office hours for expert money advice, debt advice, debt solution, debt arrangement, and debt management scheme.', '', 1, 2, 'https://nationwidedebthelp.co.uk/', 'https://nationwidedebthelp.co.uk/thank-you/', 'http://bit.ly/2NXgquJ', 1, 1, 1, 1538479877, 1, 1, 0),
