(1, 'ShareAds', 'ShareAds', 'ShareAds, affiliate ', 'ShareAds organization is filled with people just like you who are interested in earning the money by sharing the ads online. We are a diverse group of people with interests in the area of sharing and earning from the Ads.', 'Get an opportunity to promote your products through our Affiliate program. Providing you a bunch of advertisers who are here to refer and market your custom products around the globe. Get revenue based on every purchase. Track your customers, your advertisers and your sales. Sign up and get scripts to avail this offer for your ecommerce website. Get Real time reports and on time payments.', 'Providing a versatile platform to earn commission and revenues by promoting and referring products. Earn the highest commission and sign up for native affiliate program. Get a bunch of products along with their website URL posted by publishers. Share an embedded link on social platforms to get traffic. More the traffic, More will be your sale. Get reports and track your visitors and sales against every platform. ', 40, 'info@shareads.com', ' ', ' ', 'Markris Media Suite 40 Cariocca \r\nBusiness Park, 2 Sawley Road, \r\nManchester, United Kingdom, M40 8BB', 'https://www.facebook.com/shareads.com/', 'https://twitter.com/share_ads', '', '', 31, '0ae0c8916f', '49bbe4d45b8846dba3f96ec72952d49a-us9', '', '', '<!-- Start of arhamsoft Zendesk Widget script -->\r\n<script id=\"ze-snippet\" src=\"https://static.zdassets.com/ekr/snippet.js?key=f5f0879f-ade5-4c56-ab9f-1d45f42c161a\"> </script>\r\n<!-- End of arhamsoft Zendesk Widget script -->', '', 'Welcome To ShareAds!', 'a:2:{i:1;s:2:\"20\";i:2;s:2:\"20\";}', 2, 2, 'shareadslive', 'R_4b2d75dcc179480991d51f0ca917b6e5', 'To activate the Product this is Mandatory to add the following script at the header of the Referral Website. If you will not add the script listed below the product site will not be activated and verified.\r\n\\n\r\n<script src=\"https://shareads.com/assets/site/js/shareads.min.js\"></script>\r\n\\n\r\nThe following script must be added at the header of success page where your sales get completed. Ensure to add this script before the activation of your product to make it verifiable. \r\n\\n\r\n<script src=\"https://shareads.com/assets/site/js/shareads_catcher.min.js\"></script>\r\n\\n\r\nPass the Transaction ID and Order ID parameters in the Script through function at the Success page to verify the sales. If you feel any difficulty adding the Script must consult your Developer otherwise your Product will not be verified. \r\n\\n\r\n$(function(){orderCatcherForm.init(\'{YOUR_UNIQUE_ORDER_ID}\',\'{YOUR_UNIQUE_TRANSACTION_ID}\');\r\n\\n');
