(1, 2, '<p><span style=\"font-size:16px;\">We&rsquo;re so excited to welcome you to the ShareAds and every single one of us is here to help you reach new heights as ShareAds is one of the best Ad sharing platform that will boost your sales.</span></p>\r\n\r\n<p><span style=\"font-size:16px;\">You are important to us! we did deep research in your business and found some products could be really profitable for you. We&#39;ve already listed some products in the product listing accordingly. The only action required by you is product activation. Kindly activate the products to start your sales.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:16px;\">You can view, update, or activate your products. You can view all the sales report using your dashboard.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:12px;\"><strong>Alert: Kindly update your password to avoid any inconvenience.&nbsp;</strong>&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2019-03-20 19:34:06'),
(2, 3, '<p>We&rsquo;re so excited to welcome you to the ShareAds and every single one of us is here to help you reach new heights as ShareAds is one of the best Ad sharing platform that will boost your sales.</p>\r\n\r\n<p>You are important to us! We have a big number of expert advertisers that will help you by sharing your products on all major social media platforms to boost your sales and business.</p>\r\n\r\n<p>You can add, view, update, or activate your products. You can view all the sales report using your dashboard.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>Alert: Kindly update your password to avoid any inconvenience.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2019-03-20 14:49:04');
